import banner from "../images/icons/banner.svg";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <main>
      <div className="sm:grid md:flex md:justify-start md:items-center">
        <img src={banner} alt="" className="bg-gradient-to-bl from-cyan-500 to-blue-500 border border-black" />
        <div className="md:absolute grid sm:text-center md:text-left">
          <h1>Besoin d'aide?</h1>
          <p>Trouver un bricoleur proche de chez vous!</p>
          <Link to="/">
            <button>Trouver un Bricoleur</button>
          </Link>
        </div>
      </div>
    </main>
  );
};

export default Home;
